import React from 'react';
import './Blog_nav.css';
import { objectives } from "../../../Components/objectives/data";

const BlogNav = () => {
    const { title, author, image } = objectives[0]; // Assuming you want to use the first objective's data

    return (  
        <header>
            <div className="header-in">
                <div className="header-in-one">
                    <p>Back Home</p>
                    <p>Help</p>
                </div>
                <div className="header-in-two">
                    <div className="in-two-one">
                        <h1>{title}</h1>
                        <h1>{author}</h1>
                    </div>
                    <div className="in-two-two">
                        <img src={image} alt="Blog Image" />
                    </div>
                </div>
            </div>
        </header>
    );
}

export default BlogNav;
